private InventDimId inventDimIdForAlternativeItem(InventTable _inventTableCaller)
{
    Enumerator enum = InventProductDimension::getEnumeratorForEnabledDimensions();

    InventDim inventDimAltItemCreate;

    while (enum.moveNext())
    {
        InventProductDimension productDim = enum.current();
        inventDimAltItemCreate.(productDim.parmInventDimFieldId()) = productDim.parmAlternativeValueForItem(_inventTableCaller);
    }
    inventDimAltItemCreate.clearNotActiveDim(InventDimGroupSetup::newItemId(_inventTableCaller.AltItemId));
    return InventDim::findOrCreate(inventDimAltItemCreate).InventDimId;
}

/// <summary>
/// Initializes from caller.
/// </summary>
/// <returns>A container with <c>ItemId</c> and <c>InventDimId</c></returns>
protected container initFromCaller()
{
    ItemId          itemId;
    InventDimId     inventDimId;

    if (element.args().caller() && 
        element.args().caller().name() == element.form().name())
    {
        //It is called from the alternative item, so get all properties from caller
        InventTable inventTableCaller = element.args().record() as InventTable;
        itemId = inventTableCaller.AltItemId;

        qty.realValue(element.args().caller().qty());
        receiptDateRequested.dateValue(element.args().caller().receiptDateRequested());
        dlvMode.text(element.args().caller().dlvMode());

        var altAddress = element.args().caller().addressMap() as LogisticsPostalAddressMap;

        if (altAddress)
        {
            LogisticsPostalAddressMap::initMapFromMap(tmpAddress, altAddress);
        }

        inventDimId = this.inventDimIdForAlternativeItem(inventTableCaller);
    }
    else if (   element.args().dataset() == tableNum(InventTable)
             || element.args().dataset() == tableNum(InventSum))
    {
        //Use InventTable as default value
        if (element.args().dataset() == tableNum(InventTable))
        {
            InventTable inventTableCaller = element.args().record() as InventTable;
            itemId = inventTableCaller.ItemId;
        }
        else
        {
            InventSum inventSumCaller = element.args().record() as InventSum;
            itemId = inventSumCaller.ItemId;
        }

        qty.realValue(0);
        receiptDateRequested.dateValue(dateNull());
        dlvMode.text('');

        inventDimId = InventDim::inventDimIdBlank();
    }
    else if (element.args().dataset() == tableNum(SalesLine))
    {
        //Use values from salesLine
        SalesLine salesLine = element.args().record() as SalesLine;
        itemId = salesLine.ItemId;

        qty.realValue(salesLine.RemainSalesPhysical);
        receiptDateRequested.dateValue(salesLine.ReceiptDateRequested);
        dlvMode.text(salesLine.DlvMode);

        custTable = salesLine.salesTable().custTable_CustAccount();

        LogisticsPostalAddressMap::initMapFromLocation(tmpAddress, salesLine.deliveryLocation());
        address_Name.text(salesLine.DeliveryName);

        inventDimId = salesLine.InventDimId;
        dateReq = SalesLine.ReceiptDateRequested;
    }

    return [itemId, inventDimId];
}

public void init()
{
    ItemId          itemId;
    InventDimId     inventDimId;

    super();

    dateReq = DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone());

    [itemId, inventDimId] = this.initFromCaller();

    if (!itemId)
    {
        throw error("@SYS59363");
    }

    address_ds.query().dataSourceTable(tableNum(LogisticsPostalAddress)).clearDynalinks();

    inventTable_ds.query().dataSourceTable(tableNum(InventTable)).clearDynalinks();
    inventTable_ds.query().dataSourceTable(tableNum(InventTable)).clearLinks();
    inventTable_ds.query().dataSourceTable(tableNum(InventTable)).addRange(fieldNum(InventTable,ItemId)).value(queryValue(itemId));

    inventDim_ds.query().dataSourceTable(tableNum(InventDim)).clearDynalinks();
    inventDim_ds.query().dataSourceTable(tableNum(InventDim)).addRange(fieldNum(InventDim,InventDimId)).value(queryValue(inventDimId));

    inventSupplyTmpOnhand_ds.query().dataSourceTable(tableNum(InventSupplyTmpOnhand)).clearDynalinks();
    inventSupplyTmpOrders_ds.query().dataSourceTable(tableNum(InventSupplyTmpOrders)).clearDynalinks();
    inventSupplyTmpVendors_ds.query().dataSourceTable(tableNum(InventSupplyTmpVendors)).clearDynalinks();
    inventSupplyTmpStdLeadtime_ds.query().dataSourceTable(tableNum(InventSupplyTmpStdLeadtime)).clearDynalinks();

    element.updateDesignRequirement(InventDimFormDesignUpdate::Init);
    element.updateDesignOnhand(InventDimFormDesignUpdate::Init);
    element.updateDesignStdLeadTime(InventDimFormDesignUpdate::Init);
    element.updateDesignAltItem(InventDimFormDesignUpdate::Init);
}

