void refreshTmpData(boolean _refreshOnlyTmp = true)
{
    InventSupplyTmpOrders   ordersTmp;
    InventSupply            inventSupply;

    element.updateDesignRequirement(InventDimFormDesignUpdate::Init);
    element.updateDesignOnhand(InventDimFormDesignUpdate::LinkActive);
    element.updateDesignStdLeadTime(InventDimFormDesignUpdate::LinkActive);
    element.updateDesignAltItem(InventDimFormDesignUpdate::LinkActive);

    //Create new class to generate temporary data
    inventSupply = InventSupply::newFromForm(inventTable,
                                            element.qty(),
                                            element.addressMap(),
                                            inventDim,
                                            any2Enum(dlvModeSupp.item(dlvModeSupp.selection())),
                                            any2Enum(dlvModeCust.item(dlvModeCust.selection())),
                                            onlyTransportRelation.checked(),
                                            element.dlvMode(),
                                            custTable.SalesCalendarId);

    //Set temporary data for Onhand tab
    inventSupplyTmpOnhand.setTmpData(inventSupply.createTmpDataOnhand(inventDimFormSetupOnhand.parmDimParmVisibleGrid()));

    //Set temporary data for Orders tab, and include planned orders if selected
    ordersTmp = inventSupply.createTmpDataOrdersReal(inventDimFormSetupOnhand.parmDimParmVisibleGrid());
    if (plannedOrders.checked())
    {
        ordersTmp = inventSupply.createTmpDataOrdersPlanned(ordersTmp,inventDimFormSetupOnhand.parmDimParmVisibleGrid());
    }
    inventSupplyTmpOrders.setTmpData(ordersTmp);

    //Set temporary data for Vendors and Standard leadtimes tab
    inventSupplyTmpVendors.setTmpData(inventSupply.createTmpDataVendors());
    inventSupplyTmpStdLeadTime.setTmpData(inventSupply.createTmpDataStdLeadTime());

    //Refresh all grid datasources to reflect changes to temp data
    inventSupplyTmpOnhand_ds.research();
    inventSupplyTmpOrders_ds.research();
    inventSupplyTmpVendors_ds.research();
    inventSupplyTmpStdLeadTime_ds.research();

    //Refresh all fast tab summary datasources to reflect changes to temp data
    TmpFastTabHelperOnHand_ds.executeQuery();
    TmpFastTabHelperOrders_ds.executeQuery();
    TmpFastTabHelperVendors_ds.executeQuery();

    if (!_refreshOnlyTmp)
    {
        inventSumQT_ds.executeQuery();
        inventSumAltItem_ds.executeQuery();
    }
}

void rightClickModifyQuery()
