    element.refreshTmpData(false);
}

void updateDesignAltItem(InventDimFormDesignUpdate mode)
{
    switch (mode)
    {
        case InventDimFormDesignUpdate::Init          :
        //Initialization is done automatically when calling element.inventSimSetupObjectAltItem()

        case InventDimFormDesignUpdate::Active    :
        case InventDimFormDesignUpdate::LinkActive    :

            //Set visible invent dim columns to the same as on Onhand and Orders tab
            element.inventDimSetupObjectAltItem().parmDimParmVisible(element.inventDimSetupObject().parmDimParmVisible());
            element.inventDimSetupObjectAltItem().parmDimParmVisibleGrid(element.inventDimSetupObject().parmDimParmVisibleGrid());

            element.inventDimSetupObjectAltItem().formActiveSetup(InventDimGroupSetup::newItemId(inventTable.AltItemId), inventTable);
            element.inventDimSetupObjectAltItem().formSetControls(true,true);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

void updateDesignOnhand(InventDimFormDesignUpdate _mode)
{
    Set            validDataSources;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetupOnhand)
            {
                validDataSources = new Set(Types::String);
                validDataSources.add(inventSupplyTmpOnhand_DS.name());
                validDataSources.add(inventDimOnhand_DS.name());
                validDataSources.add(inventSupplyTmpOrders_DS.name());
                validDataSources.add(inventDimOrder_DS.name());
                validDataSources.add(inventSumQT_DS.name());
                validDataSources.add(inventDimQT_DS.name());
                validDataSources.add(inventSumAdjOnHand_DS.name());
                validDataSources.add(inventDimAdjOnHand_DS.name());
                inventDimFormSetupOnhand = InventDimCtrl_Frm_Supply::newFromFormValidDataSources(element, validDataSources);
            }
        // do continue
        case InventDimFormDesignUpdate::Active:
        case InventDimFormDesignUpdate::LinkActive:

            inventDimFormSetupOnhand.formActiveSetup(InventDimGroupSetup::newInventTable(inventTable));
            inventDimFormSetupOnhand.formSetControls(true);
            break;

        default : throw error(strfmt("@SYS54195",funcname()));
    }
}

void updateDesignRequirement(InventDimFormDesignUpdate _mode)
{
    InventDimParm       inventDimParm;
    Set                 validDataSources;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetupRequirement)
            {
                validDataSources = new Set(Types::String);
                validDataSources.add(inventDim_DS.name());
                inventDimFormSetupRequirement  = InventDimCtrl::newFromFormValidDataSources(element,validDataSources);
            }
        // do continue
        case InventDimFormDesignUpdate::Active      :
        case InventDimFormDesignUpdate::LinkActive  :

            //Enable all active dimensions
            InventDimGroupSetup::newInventTable(inventTable).inventDimParmActive(inventDimParm);

            inventDimFormSetupRequirement.parmDimParmVisibleGrid(inventDimParm);
            inventDimFormSetupRequirement.parmDimParmEnabled(inventDimParm);

            inventDimFormSetupRequirement.formSetControls(true);
            break;
    }
}

void updateDesignStdLeadTime(InventDimFormDesignUpdate mode)
{
    InventDimParm                   inventDimParm;
    Set                             validDataSources;
    InventDimGroupSetup             inventDimGroupSetup;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :

            if (! inventDimFormSetupStdLeadTime)
            {
                validDataSources = new Set(Types::String);
                validDataSources.add(inventSupplyTmpStdLeadTime_DS.name());
                validDataSources.add(inventDimStdLeadTime_DS.name());
                inventDimFormSetupStdLeadTime  = InventDimCtrl::newFromFormValidDataSources(element,validDataSources);
            }
        // do continue
        case InventDimFormDesignUpdate::Active      :
        case InventDimFormDesignUpdate::LinkActive  :

            inventDimGroupSetup = InventDimGroupSetup::newInventTable(inventTable);
            //Show fields that is coverage planned per dimension (like in Item Coverage form)
            inventDimParm.initCovReqItemTable(inventDimGroupSetup);
            inventDimParm.InventSiteIdFlag = NoYes::Yes; //Also show site if it is not already being shown

            inventDimFormSetupStdLeadTime.parmDimParmVisibleGrid(inventDimParm);
            inventDimFormSetupStdLeadTime.parmDimParmEnabled(inventDimParm);

            inventDimFormSetupStdLeadTime.formSetControls(true);
            break;
    }
}

