// Edit method is used instead of binding the control to the CountryRegionId field directly because the field is marked as mandatory on the LogisticsPostalAddress table
// and it is not possible to set mandatory(false) on the control that is bound to a mandatory field.
// The reason why CountryRegionId field should be optional is because it is used as a filter on this form and does not need to be specified.
public edit LogisticsAddressCountryRegionId editCountryRegionId(boolean _set, LogisticsPostalAddress _address, LogisticsAddressCountryRegionId _countryRegionId)
{
    if (_set)
    {
        _address.CountryRegionId = _countryRegionId;
    }

    return _address.CountryRegionId;
}

public display InventQty pdsAdjTotl(InventSum _inventSum)
{
    PdsCustSellableDays custSellableDays;
    PdsSellableDays     sellableDays = 0;
    if (#PdsEnabled)
    {
        custSellableDays = PdsCustSellableDays::findValidRec(_inventSum.itemId, custTable.AccountNum,_inventSum.joinChild());
        if (custSellableDays.RecId)
        {
            sellableDays = custSellableDays.sellableDays;
        }
        return _inventSum.AvailOrderedCalculated()
                - this.pdsExpiredPhysical(_inventSum)
                - this.pdsNonNetPhysical(_inventSum);
    }
    return 0;
}

