public int active()
{
    int ret;
    PdsCustSellableDays custSellableDays;
    PdsSellableDays     sellableDays = 0;

    if (#PdsEnabled)
    {
        custSellableDays = PdsCustSellableDays::findValidRec(InventSumAdjOnHand.itemId, custTable.AccountNum,InventDimAdjOnHand);
        if (custSellableDays.RecId)
        {
            sellableDays = custSellableDays.sellableDays;
        }

        expiredPhysical = InventSumAdjOnHand.pdsCustExpiredPhysical(sellableDays, dateReq, InventSumAdjOnHand.joinChild());
        nonNetPhysical  = InventSumAdjOnHand.pdsNonNetPhysical(inventSumAdjOnHand.joinChild());
    }
    ret = super();

    return ret;
}

