public void executeQuery()
{
    TmpFastTabHelper        helper;
    InventSupplyTmpOnhand   onHand;

    onHand.setTmpData(inventSupplyTmpOnhand);

    select sum(PhysicalInvent), sum(AvailPhysical) from onHand;

    helper.StringValue = strfmt("@SYS4007372", onHand.PhysicalInvent, onHand.AvailPhysical);
    helper.insert();

    TmpFastTabHelperOnHand.setTmpData(helper);

    super();
}

public void executeQuery()
{
    TmpFastTabHelper        helper;
    InventSupplyTmpOrders   orders;

    orders.setTmpData(inventSupplyTmpOrders);

    select sum(OrderedSum) from orders;

    helper.StringValue = strfmt('%1', orders.OrderedSum);
    helper.insert();

    TmpFastTabHelperOrders.setTmpData(helper);

    super();
}

public void executeQuery()
{
    TmpFastTabHelper        helper;
    InventSupplyTmpVendors  vendors;

    vendors.setTmpData(inventSupplyTmpVendors);

    select count(RecId) from vendors;

    helper.IntegerValue = int642int(vendors.RecId);
    helper.insert();

    TmpFastTabHelperVendors.setTmpData(helper);

    super();
}

