public boolean modified()
{
    boolean ret;

    ret = super();

    this.validate();

    return ret;
}

public boolean validate()
{
    boolean ret;
    DlvMode dlvModeFound;

    ret = super();

    if (dlvMode.text())
    {
        dlvModeFound = DlvMode::find(dlvMode.text());
        if (!dlvModeFound)
        {
            ret = ret && checkFailed(strFmt("@SYS55265", dlvMode.text(), fieldPName(DlvMode, Code), tablePName(DlvMode)));
        }
        else
        {
            dlvMode.text(dlvModeFound.Code);
        }
    }

    return ret;
}
